(78383174, 8570605, 0, 10, 10, 2, false, '2017-01-09T01:35:43', '2022-03-12T22:20:39', '2017-09-09T03:53:03', '2022-07-04T19:23:21.91', 'CFR', 'gamaleldin/CFR', 'This code package is for the Corrected-Fisher-Randomization (CFR) method. This method generates random surrogate data that preserves a specified set of first and second order marginal moments of a data tensor, which makes it well equipped to test for the null hypothesis that a structure in data is an epiphenomenon of these specified set of primary features of the data tensor. The randomization procedure used in CFR is based on Fisher randomization (shuffling). However, the shuffling is accompanied by a correction step that retains the primary features specified in the null hypothesis. Hence, the name of this method.', 'Fortran', 'UNLICENSED', ''),
